import React, { useEffect, useState } from "react";
import { Button } from 'reactstrap';
import axios from "axios"

function Reports() {
    const [reports, setReports] = useState([{
        state: '',
        type: '',
        message: ''
    }]);

    useEffect(() => {
        fetch("/reports").then(res => {
            if (res.ok) {
                return res.json()
            }
        }).then(jsonRes => setReports(jsonRes));
        console.log(jsonRes)
    })

    return <div className="container">
        <h1 className="display-3">Report Page</h1>
        {reports.forEach(rep => {
            <div>
                <h3>{rep.state}</h3>
                <p>{rep.type}</p>
                <p>{rep.message}</p>
            </div>
        })}
        <p className="lead">
            <Button color="primary">Resolve</Button>
        </p>
        <p className="lead">
            <Button color="danger">Block</Button>
        </p>
    </div>
}

export default Reports;
